        <text transform="translate(705.66 1228.72)" style="font-size:12px;font-family:Oswald-Regular, Oswald">Lord Commander Mormont&apos;s Gre<tspan x="139.88" y="0" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="144.9" y="0" style="letter-spacing:-0.000040690104166666664em">t Ranging north of the </tspan><tspan x="243.28" y="0" style="letter-spacing:-0.016031901041666668em">W</tspan><tspan x="251.84" y="0" style="letter-spacing:0.000040690104166666664em">all reaches the Fist of </tspan><tspan x="0" y="14.4">the First Men. Jon Sn</tspan><tspan x="89.97" y="14.4" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="94.98" y="14.4" style="letter-spacing:-0.000040690104166666664em">w joins Qhorin Halfhand in scouting out the main wildling </tspan><tspan x="0" y="28.8">camp of King-Beyond-the-</tspan><tspan x="114.13" y="28.8" style="letter-spacing:-0.0159912109375em">W</tspan><tspan x="122.69" y="28.8">all Mance Rayder in the Frostfang Mountains. Jon </tspan><tspan x="0" y="43.2">encounters the wildling spearwife </tspan><tspan x="149.06" y="43.2" style="letter-spacing:-0.0159912109375em">Y</tspan><tspan x="154.64" y="43.2">gritte, but he and Qhorin are l</tspan><tspan x="283.62" y="43.2" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="288.63" y="43.2" style="letter-spacing:-0.000040690104166666664em">ter captured. </tspan><tspan x="0" y="57.6">Qhorin convinces Jon to kill him to convince the wildlings th</tspan><tspan x="259.27" y="57.6" style="letter-spacing:-0.008015950520833334em">a</tspan><tspan x="264.29" y="57.6" style="letter-spacing:0.000040690104166666664em">t he intends to </tspan><tspan x="0" y="72">defect, so Jon can infiltr</tspan><tspan x="103.8" y="72" style="letter-spacing:-0.008015950520833334em">a</tspan><tspan x="108.81" y="72" style="letter-spacing:0.000040690104166666664em">te Mance Rayder&apos;s army from within. </tspan></text>
        <text transform="translate(167.51 1907.72)" style="font-size:12px;font-family:Oswald-Regular, Oswald">Jon Sn<tspan x="27.67" y="0" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="32.68" y="0" style="letter-spacing:-0.000040690104166666664em">w meets Mance Rayder and gains his trust, and is sent with a scouting party </tspan><tspan x="0" y="14.4">led by </tspan><tspan x="28.67" y="14.4" style="letter-spacing:-0.012003580729166666em">T</tspan><tspan x="33.48" y="14.4">ormund to scale the </tspan><tspan x="122.65" y="14.4" style="letter-spacing:-0.0159912109375em">W</tspan><tspan x="131.21" y="14.4">all. </tspan><tspan x="0" y="28.8">But before th</tspan><tspan x="57.66" y="28.8" style="letter-spacing:-0.008015950520833334em">a</tspan><tspan x="62.67" y="28.8" style="letter-spacing:0.000040690104166666664em">t, Jon Sn</tspan><tspan x="99.03" y="28.8" style="letter-spacing:-0.008015950520833334em">o</tspan><tspan x="104.04" y="28.8">w falls in love and loses his virginity to a wildling </tspan><tspan x="318.88" y="28.8" style="letter-spacing:-0.0159912109375em">Y</tspan><tspan x="324.46" y="28.8">gritte in </tspan><tspan x="0" y="43.2">a cave.</tspan><tspan x="0" y="57.6">They successfully pass over to the south side, and intend to </tspan><tspan x="259.36" y="57.6" style="letter-spacing:-0.008015950520833334em">a</tspan><tspan x="264.38" y="57.6" style="letter-spacing:0.000040690104166666664em">ttack Castle Black </tspan><tspan x="0" y="72">from its undefended rear to distract its small garrison while Mance&apos;s main army </tspan><tspan x="0" y="86.4">assaults the </tspan><tspan x="54.99" y="86.4" style="letter-spacing:-0.0159912109375em">W</tspan><tspan x="63.55" y="86.4">all directly. Eventually Jon escapes the wildlings.</tspan></text>

        <text transform="translate(750.55 5412.72)" style="font-size:12px;font-family:Oswald-Regular, Oswald">Jon Sn<tspan x="27.67" y="0" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="32.67" y="0">w and Daenerys </tspan><tspan x="103.51" y="0" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="108.3" y="0">argaryen travel to Winterfall to join forces against the Night King and his Army </tspan><tspan x="0" y="14.4">of the Dead. Even though the Northerners are not happy about their alliance, they agree to it.</tspan><tspan x="0" y="43.2">Jon Sn</tspan><tspan x="27.67" y="43.2" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="32.67" y="43.2">w finds out from his best friend Samwell </tspan><tspan x="210.69" y="43.2" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="215.48" y="43.2">arly and a brother Brandon Stark, n</tspan><tspan x="368.62" y="43.2" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="373.63" y="43.2">w a Three Eyed </tspan><tspan x="0" y="57.6">Raven, th</tspan><tspan x="40.31" y="57.6" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="45.32" y="57.6">t he is not a bastard, but a rightful heir to the Iron Throne, as he is the son of Lyanna Stark and </tspan><tspan x="0" y="72">Rhaegar </tspan><tspan x="38.66" y="72" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="43.45" y="72">argaryen, the l</tspan><tspan x="106.2" y="72" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="111.21" y="72">te Prince of Dra</tspan><tspan x="179.65" y="72" style="letter-spacing:-0.003987630208333333em">g</tspan><tspan x="184.82" y="72">onstone, which also makes Daenerys </tspan><tspan x="345.45" y="72" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="350.24" y="72">argaryen his aunt. After </tspan><tspan x="0" y="86.4">the b</tspan><tspan x="22.2" y="86.4" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="27.22" y="86.4">ttle against the Night King and his Army of the Dead is won, Jon Sn</tspan><tspan x="316.26" y="86.4" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="321.26" y="86.4">w tells Daenerys </tspan><tspan x="395.15" y="86.4" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="399.93" y="86.4">argaryen the </tspan><tspan x="0" y="100.8">truth about his parenta</tspan><tspan x="100.68" y="100.8" style="letter-spacing:-0.003987630208333333em">g</tspan><tspan x="105.85" y="100.8">e. Daenerys </tspan><tspan x="158.51" y="100.8" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="163.3" y="100.8">argaryen begs him not to share this secret to anyone, and Jon Sn</tspan><tspan x="443.01" y="100.8" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="448.02" y="100.8">w </tspan><tspan x="0" y="115.2">declares once again his loyalty to her, but is unable to keep the secret from his brother and sisters.</tspan><tspan x="0" y="144">With a weakened army, Daenerys </tspan><tspan x="146.35" y="144" style="letter-spacing:-0.013997395833333334em">T</tspan><tspan x="151.14" y="144">argaryen travels to the King’s Landing to defe</tspan><tspan x="348.49" y="144" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="353.5" y="144">t the queen Cersei </tspan><tspan x="0" y="158.4">Lannister, and Jon Sn</tspan><tspan x="91.34" y="158.4" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="96.35" y="158.4">w foll</tspan><tspan x="120.19" y="158.4" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="125.19" y="158.4" style="letter-spacing:-0.00008138020833333333em">ws along </tspan><tspan x="165.68" y="158.4" style="letter-spacing:-0.007975260416666666em">a</tspan><tspan x="170.7" y="158.4">t a sl</tspan><tspan x="192.24" y="158.4" style="letter-spacing:-0.007975260416666666em">o</tspan><tspan x="197.24" y="158.4">wer pace.</tspan><tspan x="0" y="172.8">TBC</tspan></text>
